import React, {useState} from 'react';
import './styles.css';

var ContactUs = () => {
    return(
        <div className='container'>
            <br />
            <br />
            <h1>نتشرف بتواصلك معنا من خلال:</h1>
            <br />
            <img src="https://img.icons8.com/external-justicon-flat-justicon/30/000000/external-whatsapp-social-media-justicon-flat-justicon.png"/><h3>واتسآب</h3>
        </div>
    );
}

export default ContactUs;
